// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract ColourPulse is ERC721, ERC721Enumerable, ERC721URIStorage, Pausable, AccessControl, ERC721Burnable {
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    Counters.Counter private _tokenIdCounter;

    constructor() ERC721("ColourPulse", "CLP") {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(PAUSER_ROLE, msg.sender);
        _setupRole(MINTER_ROLE, msg.sender);
    }

    function pause() public onlyRole(PAUSER_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(PAUSER_ROLE) {
        _unpause();
    }

    // function safeMint(address to) public onlyRole(MINTER_ROLE) {
    //     _safeMint(to, _tokenIdCounter.current());
    //     _tokenIdCounter.increment();
    // }

    function _beforeTokenTransfer(address from, address to, uint256 tokenId)
        internal
        whenNotPaused
        override(ERC721, ERC721Enumerable)
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    // The following functions are overrides required by Solidity.

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721Enumerable, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }

    // CUSTOM FUNCTIONS

    mapping(uint256 => uint256) private stripeCountMapping;
    mapping(uint256 => bool) private verticalMapping;
    // mapping(uint256 => uint256) xCoordMapping;
    // mapping(uint256 => uint256) widthMapping;
    // mapping(uint256 => uint256) durationMsMapping;
    // mapping(uint256 => string) colourMapping;

    function isSenderAdmin() public view returns (bool) {
        return hasRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }


    function mintStripes(uint256 _stripeCount, bool _vertical) public {
        uint256 tokenId = _tokenIdCounter.current();
        _safeMint(msg.sender, tokenId);
        stripeCountMapping[tokenId] = _stripeCount;
        verticalMapping[tokenId] = _vertical;

        _tokenIdCounter.increment();
    }

    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

    function generateSvg(uint256 _tokenId) public view returns (string memory) {

        // bytes memory seed = abi.encodePacked(bytes32(_tokenId));
        uint stripeCount = stripeCountMapping[_tokenId];
        bool vertical = verticalMapping[_tokenId];

        if (stripeCount == 0) {
            stripeCount = 1;
        }
        uint rotation = vertical ? 0 : 90;
        uint stripeWidth = 2000 / stripeCount;
        uint xPos = 0;

        string memory svg = string(abi.encodePacked("<svg xmlns='http://www.w3.org/2000/svg' viewBox='0 0 2000 2000' transform='rotate(", uint2str(rotation), ")'>"));

        for (uint i = 0; i < stripeCount; i++) {
            string memory rect = string(abi.encodePacked("<rect x='", uint2str(xPos), "' y='0' width='", uint2str(stripeWidth), "' height='2000' shape-rendering='crispEdges'><animate begin= '0s' dur='", uint2str(i + 1), "s' attributeName='fill' values='#222222;#BBFFBB;#222222' fill='freeze' repeatCount='indefinite' /></rect>"));
            svg = string(abi.encodePacked(svg, rect));
            xPos += stripeWidth;
        }

        svg = string(abi.encodePacked(svg, "</svg>"));

        return svg;
    }
}

